const rows = tsv.split('\n').map(str => str.split('\t'));
const headers = rows.shift();
const years = headers.slice(1).map(n => +n);

const countries = rows.map(row => {
	return {
		name: row[0],
		data: years.map((year, i) => ({
			x: year,
			y: +row[i + 1]
		})).filter(d => d.y)
	};
});

export { years, countries };